import styled from 'styled-components';

const BoxQuestion = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: space-between;
  padding: 20px;
  width: 439px;
  height: 286px;
  color: #000000;
  background: #FFFFFF;
  box-shadow: 1px 4px 13px 2px rgba(0, 0, 0, 0.2);
  border-radius: 10px;
`;

export default BoxQuestion;
